in vi tng cng sut ln n 8.000tn/nm.\nNh my sn xut nha Alkyd Resin, Acrylic Modified Alkyd\nNh my sn xut Sn PU c din tch trn 7.000 m vi nhim v sn xut v cung ng sn phm Sn g cao cp p ng nhu cu trong nc v xut khu. Dy chuyn sn xut Sn PU ng dng cng ngh hin i, t ng ha ca Cng Ha Lin Bang c, V th cc sn phm Sn PU mang nhn hiu Level lun m bo cht lng vt tri, tnh nng u vit, an ton, thn thin vi mi trng v t tiu chun quc t.\nNh my sn xut Sn PU\nVi tinh thn khng ngng cu th cng h thng qun tr hin i ,i ng CBNV c trnh  chuyn mn cao chng ti  n lc  t c v th l doanh nghip cung ng nguyn liu c bn, Sn Pu, du mu, nhin ph liung trong top u cho cc Nh Phn Phi, Nh my, Doanh nghip phn phi, sn xut, gia cng sn phm ngnh sn v hng g ni, ngoi tht p ng cho nhu cu ca hot ng xut khu v ni tiu.\nCn b cng nhn vin Cng ty Euronano\nCng ty CP CNC EURONANO cam kt s mang n cho Qu Khch Hng nhng dng sn phm cht lng cao, dch v hon ho, kp thi vi cht lng vt tri, tin ch a dng, t tiu chun an ton trong s dng v thn thin vi mi trng.','Y','2020-07-06 10:28:44','14.162.84.203','2020-06-30 10:17:08','2020-06-30 17:04:38','Ms Dip','L Q ng s 6B,KCN Ha Khnh,Phng Ha Khnh Bc,Qun Lin Chiu,Thnh Ph  Nng,Vit Nam','0',1,0,0,'','','','','','','','','tuyendung@hiepnghia.com.vn CONG TY CO PHAN HOA CHAT CONG NGHE CAO EURONANO 3093763'),(3093764,'1de9d66bd64940b01f609c3c1167336da0fdecf8@sieu-viet.com','Cng Ty C Phn My Cng Nghip Trng An','cong-ty-co-phan-may-cong-nghiep-truong-an','S 10 ng S 8, Kp3, P.Linh Xun, Q.Th c',1,'','',1,2,'','','Cng Ty C Phn My Cng Nghip Trng An','Y','2020-07-06 08:08:51','42.117.51.52','2020-06-30 10:19:22','2020-06-30 10:27:05','Phng Nhn S','S 10 ng S 8, Kp3, P.Linh Xun, Q.Th c','0',0,0,0,'','','','','','','','','nhansu@maylambanhmi.vn Cong Ty Co Phan May Cong Nghiep Truong An 3093764'),(3093765,'e4f73850c1e3c048f0ab6dd59550b0de912e22c5@sieu-viet.com','Trading & Hedging Commodity','trading-hedging-commodity','',1,'','',1,1,'','','','N','2020-07-02 09:56:33','14.161.5.101','2020-06-30 10:20:35','2020-06-30 10:27:18','T