 hnh rng mt\n\n2. Trm rng thm m\n\nK thut trm rng thm m ng dng trong cc trng hp :\nRng su; rng h k; sai lch v tr\nRng i mu, nhim sc, thiu sn men\nThay i kch thc, hnh dng ca rng\nRng b mn c, try xc mt ngoi\n\n3. Ty trng rng\n\nng dng nhiu k thut tin tin kt hp vi hat cht mi em li dch v chm sc rng ming tt nht.\n\n4. Cy ghp rng (Implant)\n\nC th thc hin trn tt c cc trng hp m k thut lm rng gi thng thng khng lm c.\n\n5. Rng gi cc loi\n\nCc loi hnh dch v: Tho lp ton b; Tho lp bn phn; Hm khung; Hm khung lin kt; Mo s, ton s; Rng gi trn Implant.\n\nCc k thut cao\n1. Ning rng thm m cng ngh cao\n\nTrong qu trnh iu tr, bnh nhn s c t vn, chp hnh X-Quang ton cnh  nh gi tnh trng rng ming c th.\n\nPhng php chnh nha c nhiu loi mc ci ph hp vi iu kin kinh t v nhu cu mi ngi\n\n2. Phu thut to hnh thm m hm mt\n\nCc dch v chnh hnh bao gm: Phu thut h thp g m cao, ct gc hm, to gng mt tri xoan; Phu thut iu tr ci l nu; Phu thut chnh mm;\n\n3. Cy ghp rng (Implant)\n\np dng cc k thut tin tin nht trong lnh vc cy ghp Implant nha khoa, s dng cc h thng ni ting trn th gii : Nobel Biocare (M), MIS (Israel), \n\nThc hin cc phng php: cm ghp Implant tc th sau nh rng, cm ghp khng lt vt, nng xoang, ghp xng, phc hnh rng tm tc th sau cm ghp.\n\nS dng cc phng php phc hnh mi nht\n\ni ng bc s Chuyn khoa II, Chuyn khoa I, Thc s, c o to chuyn su v Implant trong nc v ngoi nc.\n\n4. Nh rng bng phng php gy m\n\nNh rng  tiu phu thut di gy m l phu thut rng khng au nh cc phng php gim au v an thn trong m.','Y','2020-07-01 11:31:54','115.78.10.87','2020-06-30 12:45:11','2020-06-30 13:22:51','Trang Vu','6/2 ng s 3, C X L Gia, Phng 15, Qun 11','0',0,0,0,'','','','','','','','','tracy.vu89@gmail.com Benh vien Tu Nhan chuyen khoa Rang Ham Mat My Thien 3093819'),(3093820,'3ab00e5e90a683b65c7d1d4e9750485ea2f1411c@sieu-viet.com','Cng ty TNHH Lng mi Momi','cong-ty-tnhh-long-mi-momi','Tha t 282, T Bn  S 5, KP. 4, Ph Li, TP. Th Du Mt,Bnh Dng',10,'','',1,2,'','5efad45c0e9ab_1593496668.png','Momi Eyelash Co., Ltd c thnh lp t 2017 ti