 C phn u t v Pht trin Hng Qun\nQuy m nhn s: 150 - 300 ngi\nLnh vc hot ng: Cha cp nht\na ch cng ty: P1006, nh B khch sn Th Thao, s 15 L Vn Thim, Phng Nhn Chnh, Qun Thanh Xun, Thnh ph H Ni\nTnh/thnh ph: H Ni\nin thoi c nh: 0904318484\nWebsite: Cha cp nht\nGii thiu v cng ty:\nCng ty CP u t v Pht trin Hng Qun c thnh lp t nm 2012, cung cp dch v bt ng sn chuyn nghip bao gm: T vn, mi gii, nh gi, dch v sn giao dch Bt ng sn\nC nn tng vng mnh v i ng nhn s chuyn nghip, yu ngh, c kinh nghim, v lm vic vi h thng chun mc, Hng Qun  pht trin nhanh chng. Hng Qun vinh d l n v Phn phi cc D n c quyn v pht trin D n c Uy tn ti Nha Trang nh: Panorama Nha Trang - CT Cng ty CP T Xy Dng Vnh Nha Trang, Lotus Island - Cng ty CP u t Lc Hng, Virgo Nha Trang - Cng Ty TNHH Virgo Nha Trang, D n Golden Peak Nha Trang - a ch 28 E Trn Ph Nha Trang, D n Ha Long Bay . Chng ti  v ang hp tc u t, tip th v phn phi thnh cng cc d n bt ng sn ti H Ni, Khnh Ha, Qung Ninh, H Ch Minh  cc phn khc khc nhau nh: Nh   Cn h chung c  TTTM  BS ngh dng.\nVi mong mun ng gp vo s pht trin bn vng ca th trng bt ng sn Vit Nam, hng ti s gia tng thc s cho khch hng thng qua cc dch v c cht lng cao nht; nh hng mc tiu pht trin l i tc tin cy v c u tin la chn qua cc dch v chuyn nghip, Hng Qun s khng ngng n lc phn u  tr thnh thng hiu hng u Vit Nam trong lnh vc pht trin d n, cung cp cc dch v tip th phn phi, nghin cu th trng, mi gii uy tn nht','N','2020-07-03 20:38:20','171.224.177.172','2020-07-03 20:38:20','2020-07-03 20:39:11','Phng Anh','P1006 Nh B, khch sn Th Thao, s 15 L Vn Thim, Nhn Chnh, Thanh Xun, H Ni','',0,0,0,'','','','','','','','','hongquanjschn@gmail.com Cong ty Co phan dau tu va phat trien Hong Quan 3094368'),(3094369,'ec488cdc3883e98ae76898c6ef6f7fe3927c3e54@sieu-viet.com','Cng ty TNHH Mint C & M','cong-ty-tnhh-mint-c-m','s 30 ng 64BT, Phng Bnh Trng ng, Qun 2, H Ch Minh',1,'','',1,1,'','5eff386897e4f_1593784424.png','Cho mng bn n Seoul Saigon SS59, mt a im c o  bn khm ph tt c nhng sn phm lm p ang thnh hnh  Hn Quc\n\nChuyn hng ni a Hn Quc. SS59 cam kt 100% sn phm c bn ti shop chun m phm ni a  Hn, cc sn phm Shop bn u c bn ti th trng Hn Quc. \nBn cnh , shop Chuyn cc Sn phm t Top review trn trang Naver (trang tm kim hng u Hn Quc)\nTt c cc sn phm u c nghin cu thnh phn k lng m bo cht lng, v c cp giy chng nhn ca Chnh ph Hn Quc th mi c bn ti th trng ni a Hn nn khch hng c th hon ton yn tm. \nV trn hnh trnh chm sc v lm p da s khng c khi nim sn phm tt nht, hon ho nht m ch c sn phm ph hp vi ln da ca bn nht m thi. Chng ti - tt c i ng ca SS59 s ng hnh cng bn trn hnh trnh lm p  la chn sn phm ph hp vi ln da ca bn nht.','N','2020-07-06 08:31:27','42.119.158.212','2020-07-03 20:44:55','2020-07-03 20:45:13','Daisy','s 30 ng 64BT, Phng Bnh Trng ng, Qun 2, H Ch Minh','',0,0,0,'','','','','','','','','daisy@mintgroup.vn Cong ty TNHH Mint C & M 3094369'),(3094370,'accddaed4b4554421f4d42d010836d9df408cbe1@sieu-viet.com','Cng ty TNHH nhm c Hong Nguyn','cong-ty-tnhh-nhom-duc-hoang-nguyen','137 Nguyn Th Nhung, Vn Phc City, P.Hip Bnh Phc, Q. Th c, Tp.HCM',1,'','',1,2,'','5eff3c654d6f4_1593785445.jpg','Thn gi Qu anh ch v cc bn !\nT xa n nay, gia nh chnh l khi nguyn cho thnh cng ca mi con ngi. Chnh v vy, khng kh hiu khi ngi Vit ta t xa n nay lun chm cht k lng cho ngi nh ca chnh mnh. Theo xu hng pht trin ca x hi, t thit k n ni tht trong ngi nh Vit ngy cng c o v th hin c tnh, ng cp ca ch nhn. Nhm mang li v p cng nh ng cp cho ngi nh bn, cng ty TNHH Nhm c Hong Nguyn ra i. Cng ty TNHH Nhm c Hong Nguyn chuyn cung cp cc sn phm nh ca cng, cu thang, hng ro, ban cng, bng gi  t nhm c vi nhng thit k c o mang phong cch hong gia.\nChng ti lun mong mun mang li cho khch hng nhng sn phm cht lng. Chnh v vy, bn cnh i ng nhn vin chuyn nghip c o to bi bn, chng ti cn p dng cng ngh hin i trong sn xut vi khun c c thit k 3D, sn xut bng my ct CNC hin i mang n cho bn s hi lng v  chnh xc v t m trn tng ha tit hoa vn sn phm\nVi 10 nm kinh nghim lm p cho ngi nh Vit, chng ti lun khng ngng tm ti, pht trin v cp nht nhng xu hng thit k mi trn th trng  mang n cho khch hng nhng thit k a dng, c o, sang trng v v cng thi thng.\nQua nhiu nm hot ng, chng ti  v ang nhn c s tin tng ca nhiu qu khch hng trn mi min t quc.  thc c trch nhim ca mnh trong vic gp phn dng xy mt cuc sng hon m cho khch hng, Hong Nguyn s ngy cng hon thin bn thn hn na trong tng lai  cung cp nhng nhng sn phm xng vi ng cp ca qu khch hng.\n\nTrn trng!\n\nThng tin lin h: \nNh my:	Km6, ng 21B, x Hng Quang, Huyn Nam Trc, Tnh Nam nh\nCN H Ni:	P814, HH2B Linh m, P.Hong Lit, Q.Hong Mai, Tp.H Ni.\nCN TP.HCM:	137, Nguyn Th Nhung, Vn Phc City, P.Hip Bnh Phc,Q.Th c, TP.HCM\nEmail :	nhomduchoangnguyen@gmail.com\nKinh doanh 1:	0987.863.600 \nKinh doanh 2:	0979.839.339 \nKinh doanh 3:	024.7776.9999','N','2020-07-03 20:50:16','113.22.185.195','2020-07-03 20:50:16','2020-07-03 21:10:45','Hng Nguyn','137, Nguyn Th Nhung, Vn Phc City, P.Hip Bnh Phc,Q.Th c, TP.HCM','2',0,0,0,'','','','','','','','','tuyendung.ndhn@gmail.com Cong ty TNHH nhom duc Hoang Nguyen 3094370'),(3094371,'54f9b5827dda4eaa5353af4d50107f41103d4319@sieu-viet.com','HOT JOB','hot-job','',1,'','',1,2,'','','','S','2020-07-03 21:02:01','118.71.106.252','2020-07-03 21:02:01','2020-07-03 21:02:02','o Quc Trng','','',0,0,0,'','','','','','','','','daoquoctrang95@gmail.com HOT JOB 3094371'),(3094372,'495ea62e02ac6f99b7b6ae6e35924a2a5300fb55@sieu-viet.com','TNHH i c TM v DV ng Dng Group','tnhh-dai-oc-tm-va-dv-dong-duong-group','268  Xun Hp qun 9',1,'','',1,4,'','','Tri qua hn mt thp k hnh thnh v pht trin vi mc tiu tr thnh mt trong nhng tp on ln mnh hng u Vit Nam v khu vc. Tp on ng Dng  pht trin mnh m, lin tc cung cp cho x hi nhng sn phm c cht lng cao nh: Cc khu  th, cao c vn phng, cc sn phm g cng nghip, dn dng, cc sn phm  xy dng, dch v vin thng v in nng,...','N','2020-07-06 09:02:40','171.253.139.195','2020-07-03 21:37:40','2020-07-03 21:38:33','L Cng Minh','268  Xun Hp qun 9','',0,0,0,'','','','','','','','','lecongminh131196@gmail.com TNHH Dai Oc TM va DV Dong Duong Group 3094372'),(3094373,'1a1f5862621f28