g tin cc k nhanh.\n c o to nghip v chuyn su trong lnh vc bn hng v k nng mm.','','-64-32-10-','-1-','0','','N','N','Y','','2020-07-01 15:57:13','2020-07-01 15:57:13','2020-07-20 00:00:00','Phng Nhn S','189 Nguyen Thi Minh Khai, Dist.1, Ho Chi Minh City, Vietnam'),(4488938,3094063,'[Hcm] Nhn Vin Kinh Doanh 7-9 Triu','hcm-nhan-vien-kinh-doanh-7-9-trieu-ho-chi-minh',8,'U','- T vn, gii thiu sn phm ca cng ty ang kinh doanh cho khch hng l cc cng ty, i l, i tc.\n- H tr khch hng trong qu trnh s dng dch v ca cng ty\n- Xy dng k hoch kinh doanh tun, thng, qu \n- Xy dng v pht trin tp data khch hng ca cng ty\n- Cc cng vic khc theo hng dn v yu cu ca trng b phn','- Nam n t 20 - 30 tui\n- Tt nghip Trung cp, cao ng, i hc\n- Nhit huyt, nng ng, c th chu c p lc cng vic\n- u tin cc bn  c kinh nghim sale\n- Yu cu c laptop',18,4,0,7,'Y',1,2,'- Tng thu nhp: Lng c bn: 5 - 7tr/ thng + ph cp + hoa hng + thng doanh s, thu nhp trung bnh t 10 - 12tr/ thng (tha thun theo nng lc, kinh nghim)\n- Lm vic trong mt mi trng nng ng, sng to, tr trung v y nhit huyt\n- c tp hun, o to lin tc v t vn v theo yu cu cng vic\n- c m bo y  cc quyn li theo quy nh ca Lut lao ng v Quy ch ca cng ty\n- Nhiu c hi thng tin, pht trin trong cng vic','','-32-21-35-','-1-','','','N','N','D','','2020-07-01 15:59:29','2020-07-01 15:59:29','2020-08-02 00:00:00','on Th Lng','137/32c G Du - Tn Qu- Tn Ph - H Ch Minh'),(4488939,3094063,'[Hcm] Nhn Vin Kinh Doanh 7-10 Triu','hcm-nhan-vien-kinh-doanh-7-10-trieu-ho-chi-minh',8,'U','- T vn, gii thiu sn phm ca cng ty ang kinh doanh cho khch hng l cc cng ty, i l, i tc.\n- H tr khch hng trong qu trnh s dng dch v ca cng ty\n- Xy dng k hoch kinh doanh tun, thng, qu \n- Xy dng v pht trin tp data khch hng ca cng ty\n- Cc cng vic khc theo hng dn v yu cu ca trng b phn','- Nam n t 20 - 30 tui\n- Tt nghip Trung cp, cao ng, i hc\n- Nhit huyt, nng ng, c th chu c p lc cng vic\n- u tin cc bn  c kinh nghim sale\n- Yu cu c laptop',18,4,0,7,'Y',1,2,'- Tng thu nhp: Lng c bn: 5 - 7tr/ thng + ph cp + hoa hng +