n- Trao i trc tip khi phng vn','-	Nam tui t 25 tui v cao trn 1,65m\n-	C t nht 2 nm kinh nghim li xe\n-       Trnh  tt nghip THPT\n-	C sc khe v giao tip tt. \n-	Nhanh nhn, chu kh v cn thn trong cng vic.',19,3,2,7,'Y',1,1,'- c tham gia ng BHXH, BHYT v hng cc ch  phc li theo lut lao ng.\n- Lng, thng v cc ch  i ng theo chnh sch hin hnh ca Cng ty.\n- Mi trng lm vic thn thin, nng ng\n- Lng thng 13','- u tin np h s trc tuyn qua h thng ca Timviecnhanh.com\n- Hoc gi CV m t qu trnh hc tp v lm vic v email lin h','-60-20-','-17-','496','','Y','Y','Y','','2020-07-01 16:03:57','2020-07-06 08:27:07','2020-07-15 00:00:00','Ch Hong Ni','Lapaz Tower, 38 Nguyn Ch Thanh, Q. Hi Chu, Tp  Nng'),(4488942,3002739,'Nhn Vin Qun L Tri Nghim Khch Hng Part-Time','nhan-vien-quan-ly-trai-nghiem-khach-hang-part-time-ho-chi-minh',0,'N','- Tip nhn cc phn hi, phn nh, khiu ni t khch hng v i tc qua cc knh giao tip ca cng ty nh: in thoi, email, chat .\n- Tm hiu, phn tch, nh gi cc phn nh, khiu ni.\n- Phi hp vi cc b phn lin quan  kp thi  tm ra hng gii quyt sm nht cho khch hng.\n-  xut cc phng n gii quyt khiu ni, n b vi khch hng, i tc cho b phn qun l, m bo ph hp vi cc quy nh ca - - Cng ty, php lut, nhm gii quyt tt p cc tnh hung trn tinh thn bo v li ch hp php cho Khch hng v Cng ty.\n- Thng lng v gii quyt cc phn nh, khiu ni vi khch hng theo quy trnh ca Cng ty.\n- Phi hp vi b phn truyn thng/PR  x l cc tnh hung nghim trng, c kh nng ly lan trn mng x hi.\n- Thng k tng hp bo co nh k.\n\n\n- Lng khi im: 22,000VND/gi + Ph cp chuyn cn hng thng.\n- Thi gian lm vic: C nh 1 trong hai ca: Ca sng: 8:00 - 12:00 / Ca chiu: 13:00 - 18:00 (Ti thiu 5 ngy/tun)','- N, tt nghip cao ng tr ln hoc sinh vin chuyn ngnh Dch v, Marketing, Kinh doanh...\n- Giao tip tt, c bit c kh nng lng nghe v hiu c phn hi ca ngi khc.\n- C kh nng chu p lc v kim sot cm xc tt.\n- C kh nng tm hiu, phn tch v gii quyt vn  .\n- Bit s dng cc cng c Excel, Word, Google Drive.\n- Ting Anh giao tip (s lm vic vi khch hng n t nhiu quc gia).',19,5,0,2,'Y',3,4,'- Thi gian lm vic ht sc linh ng, m bo vic hc/lm\n- C c hi hc hi lin tc nhiu th mi m\n- Hc v rn luyn cc k nng ct li: Giao tip; Lng nghe; Tng hp, phn tch thng tin; Thng lng; Qun l thi gian...\n- Hc cch sng to, th nghim cc  tng mi, ln k hoch, thc thi & bo co mt cch bi bn\n- Lm quen m hnh kinh doanh mi: cng ngh dch v (tng t Grab/Now cho ngnh git i, v sinh...). Tri nghim mi trng startup tr, nng ng & linh hot.\n- C hi c tham gia cc bui workshop c ti tr bi cng ty\n- Lm vic ngy l x3 lng\n- Tic hng qu, company outing,  n nh v cc li ch khc...','','-21-','-1-','','','N','N','N','','2020-07-01 16:06:07','2020-07-01 16:06:07','2020-07-31 00:00:00','Trn L Hng','1459 Phan Vn Tr, Phng 10, G Vp'),(4488943,2800538,'Nhn Vin Hnh Chnh K Ton (Long An)','nhan-vien-hanh-chinh-ke-toan-long-an-long-an',2,'U','- Qun l cc cng vic Hnh chnh ,nhn s: Tuyn dng; Chm cng; Tnh lng cng\nnhn\n- Qun l s liu k ton: hot ng mua bn hng ha; cng n; xut nhp kho trn\nphn mm Misa\n- Lp bo co\n-  xut  xy dng, tuyn dng v hon thin hn cc ni dung qun l thuc phm\nvi Hnh chnh, K ton, Nhn s.\n- Ni lm vic: KCN Hnh Phc, c Ho ng, c Ho, Long An\n- Thi gian lm vic: Th 2 ~ Th 7\n7:30 ~ 11:30 v 13:00 ~ 17:00 (Th 7, thi gian linh ng)','- S dng tt vi tnh vn phng.\n- S dng tt phn mm K ton Misa.\n- Ch ng trong cng vic, Bit cch t qun l, sp xp cng vic.\n- Tinh thn trch nhim cao.\n- u tin cho cc ng vin sinh sng gn ni lm vic.\n- Bit ngoi ng l mt li th\n+ ng vin np h s \n+ Phng vn qua in thoi \n+ Mi phng vn ti cng ty \n+ Thng bo kt qu v bt u cng vic',18,4,1,7,'Y',1,1,'- Lng c bn: T 6,000,000 tr ln\n- Ph cp n tra + tin thng L + lm ngoi gi + cc khon ph cp khc\n- Hng lng thng 13\n- Ch  tng lng khi hon thnh tt cng vic.\n- c hng 12 ngy ngh php c hng lng/ nm. V c qui i thnh tin\nnu khng ngh ht ngy php c hng.\n- c hng gi Bo him Sc khe ca Cng ty BH Bo Vit cho cc ng vin gn b\nvi cng ty.','','-47-29-40-','-40-','243','','Y','Y','Y','','2020-07-01 16:11:03','2020-07-02 18:14:19','2020-07-14 00:00:00','Anh Hong','KCN Hnh Phc, c Ho ng, c Ho, Long An'),(4488944,3000229,'Nhn Vin Kho Nguyn Liu (Ngh An)','nhan-vien-kho-nguyen-lieu-nghe-an-nghe-an',1,'Y','- Thc hin theo Quy trnh, Th tc Qun l kho v cc Hng dn cng vic Kho\n- Ln k hoch v trin khai tip nhn, lu tr v bo qun hng\n- Kim sot hot ng nhp, xut v cp pht cho SX trong kho\n- Chun b nguyn vt liu cho sn xut hng ngy (theo yu cu KH).\n- Tin hnh kim sot hng tn kho v bo qun hng ha theo tiu chun cht lng.\n- Nghip v kho c bn\n- Ghi chp nht k hng tn kho hng ngy.\n- Kim k kho nh k v bo co sai lch kho cho cp trn.','Trnh :\n- Cao ng, i hc cc chuyn nghnh K ton, Ti chnh\n- S dng my tnh thnh tho\n- C kin thc v qun l kho, Logistic\n\nKinh nghim:\n- C kinh nghim lm vic trn 2 nm  cc v tr tng ng c u tin\n- C kin thc v vn hnh hng ri, nhp xut nguyn liu liu hng bao v vt t khc.\n- Chu c p lc v thi gian,cng ,khi lng cng vic v c trch nhim m bo tnh chnh xc v s liu bo co.\n\nYu cu khc:\n- Ni lm vic: ti Nh my ANCO Ngh An\n- Sn sng nhn nhim v t cp trn, cng tc xa, i theo ca kp, lm vic ngoi gi;\n- Gn b lu di vi cng vic, chp nhn s iu ng phn cng cng vic ca Cp trn',10,5,2,7,'Y',1,2,'-BHXH, BHTN, BHYT theo lut\n-Bo him 24/24 theo chnh sch ca Cng ty\n-Tng lng\n- H tr cm tra\n- ng phc BHL\n- Lng thng 13, thng thnh tch theo kt qu cng vic v kt qu kinh doanh\n- Khm sc khe nh k\n- o to\n- Du lch\n- Ngy php 14 ngy /nm\n- Hiu , H , Sinh nht\n- Mi trng lm vic thn thin, n nh lu di.','','-47-30-46-','-42-','','','N','N','N','','2020-07-01 16:12:50','2020-07-01 16:12:50','2020-08-02 00:00:00','Ms.Hi','Khu C, KCN Nam Cm, KKT ng Nam Ngh An, X Nghi X, Huyn Nghi Lc, Tnh Ngh An'),(4488945,3041683,'K S M&E (i Lm Ngay)','ky-su-m-e-di-lam-ngay-ho-chi-minh',2,'Y','+ Kho st, lp bn v, bc tch khi lng bn v Thit k theo H s mi thu, bo v tnh chnh xc ca khi lng vi Ch u t theo yu cu h CTN/ in &in nh/ HVAC/ PCCC\n+ Kim tra  chnh xc ca khi lng D n, tiu chun vt t/ thit b  la chn vt t/ thit b theo ng tiu chun H s mi thu;\n+ Lp h s d thu nh cng tc bc khi lng, lp bo gi\n+ Qun l theo di tin  cc d n.\n+ Thc hin cc cng vic khc theo yu cu ca Q