.\n- Lm vic ti H Ni','Yu cu :\nTrnh  hc vn: Bng cp i hc chuyn ngnh v kinh t, ngoi thng, khoa hc x hi, vn ha,ngoi ng\n+Kin thc chuyn mn:\n+Thnh tho my tnh.\n+Trnh  ting Anh kh.\n+K nng giao tip tt.\n+Ngoi hnh a nhn, nng ng, thn thin, lch s.\n+C kh nng t chc tt, sng to, ch ng,chi tit.\n+Lch s v n cn trong mi trng hp.\nC t nht 1 nm kinh nghim  v tr tng ng.\n- Thi gian i lm: 8h  16h45 t th 2  th 6.\nLng:8tr-10tr / thng.\na ch lm vic :s 3 L Trng Tn Thanh Xun H Ni',18,6,1,7,'Y',1,2,'- Lng cn bn + Ph cp trch nhim + thng + ch  phc li y .\n- Tham gia cc kha o to nng cao nghip v bn thn, thng tin trong cng vic','','-29-21-64-','-2-','0','','N','N','N','','2020-07-06 11:30:53','2020-07-06 11:30:53','2020-07-06 00:00:00','Nguyn Ngc Bo','s 3 L Trng Tn Thanh Xun H Ni'),(4489934,3094554,'Nhn Vin Kinh Doanh','nhan-vien-kinh-doanh-ho-chi-minh',15,'U','Cng vic c th\n1. Cc bn t tm kim khch hng thng qua knh Facebook, zalo... Ngi thn, bn b...\n2. Cc bn phn tch c nhu cu khch hng da trn tui, ngh nghip, mc thu nhp, mi quan tm (sc khe, hc vn con ci, tch ly tit kim...)\n3. Chuyn thng tin qua cho ngi qun l ( NQL - Mrs Thanh ), NQL trc tip t vn v a ra gii php ti chnh cho khch hng.\n\nSTT	         S TIN			 THNG					\n  1	        10Tr-25Tr			5%					\n  2	        26Tr-45Tr			6%						\n  3	        46Tr-65Tr			7%						\n  4	        66Tr tr ln			10%						\n\nGHI CH	:\nCc bn t  3 hp ng/ thng  thng 1 triu VN\nS tin khch ng p dng cho 1 hp ng v  l ln ng u tin, khng c gi tr cng dn cc hp ng	\n\nHnh thc nhn tin\nChuyn khon hoc tin mt sau khi khch hng k hp ng v hp ng chnh thc c hiu lc sau 30 ngy.','Yu cu\n  1. Hiu v yu thch bo him\n  2. Chu kh cp nht kin thc\n  3. Trung thc',10,4,7,6,'Y',3,0,'Trao i trc tip khi PV','','-11-32-10-','-1-','','','N','N','N','','2020-07-06 11:31:40','2020-07-06 11:31:40','2020-08-07 00:00:00','Trn Th Thu Thanh','Tng 5  9, Ta nh Toto, 1A Phm Ngc Thch, Bn Ngh, Qun 1, H Ch Minh'),(4489935,3086513,'Nhn Vin Sale Pht Trin Th Trng','nhan-vien-sale-phat-trien-thi-truong-ho-chi-minh',3,'